import { Nav, NavRow, Row, Col, Card } from 'react-bootstrap';
import { connect } from 'react-redux';
import { Link, useHistory, useLocation, NavLink } from 'react-router-dom';
import { fetch_user, fetch_single_wellness } from '../api';
import Carousel from 'react-bootstrap/Carousel';

function WellnessList({ session, current_wellness}) {
  let history = useHistory();
  let location = useLocation();
  let health_id = location.pathname
  health_id = health_id.split("/wellness/")[1]
  fetch_single_wellness(health_id)
  return (
    <div>
    </div>
  );
}

const UpdateUserForm = connect(
    ({session, current_wellness}) => ({session, current_wellness}))(WellnessList);


function state2props(_state) {
  return {};
}

export default connect(state2props)(WellnessList);
